container:
  type: ColumnPanel
  properties: {col_widths: '{}'}
  event_bindings: {}
components:
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: "Affinity Propagation (AP) is an exemplar choosing method, meaning that\
      \ it assigns some unspecified number of stocks to be representative of the other\
      \ stocks. Similar to AC, the buying strategy for AP is to purchase the closest\
      \ stocks to the cluster centers - which in AP are the exemplars, as opposed\
      \ to the average of all the stocks in the cluster. AP works by repetitively\
      \ gathering four categories of information (explained below) about the stocks\
      \ and then assigning exemplar scores to each. The exemplar scores are used to\
      \ gather information in the next round, and the cycle repeats for a predetermined\
      \ number of iterations. The categories of information are \n", font_size: null,
    font: '', spacing_above: small, icon_align: left, spacing_below: small, italic: false,
    background: '', bold: false, underline: false, icon: ''}
  name: label_1
  layout_properties: {grid_position: 'PKTHJT,MUBORY'}
  event_bindings: {}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: "1.) Each stock\u2019s  \u201cresponsibility\u201d for each other stock,\
      \ defined as the difference between their closeness and the first stock\u2019\
      s highest \u201caffinity\u201d, which is the sum of \u201cresponsibility\u201d\
      \ and \u201cavailability\u201d (explained in 3 below) \n", font_size: null,
    font: '', spacing_above: large, icon_align: left, spacing_below: none, italic: false,
    background: '', bold: false, underline: false, icon: ''}
  name: label_2
  layout_properties: {grid_position: 'BEEJBD,NRGUFI'}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: '2.) The minimum closeness of any two stocks in the index

      ', font_size: null, font: '', spacing_above: none, icon_align: left, spacing_below: none,
    italic: false, background: '', bold: false, underline: false, icon: ''}
  name: label_3
  layout_properties: {grid_position: 'UYCCVR,AHGTPR'}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: "3.) Each stock\u2019s \u201cavailability\u201d to serve as an exemplar\
      \ for each other stock, which takes into account its \u201cpopular demand\u201d\
      \ (i.e. closeness to other stocks, adjusted by those stocks\u2019 highest \u201c\
      affinity\u201d to choose as an exemplar, and offset by the minimum closeness)\n\
      \ ", font_size: null, font: '', spacing_above: none, icon_align: left, spacing_below: none,
    italic: false, background: '', bold: false, underline: false, icon: ''}
  name: label_4
  layout_properties: {grid_position: 'QYMATU,ZTZZBX'}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: '4.) A total exemplar score for each stock, consisting of the sum of its
      “availability” and “responsibility”', font_size: null, font: '', spacing_above: none,
    icon_align: left, spacing_below: large, italic: false, background: '', bold: false,
    underline: false, icon: ''}
  name: label_5
  layout_properties: {grid_position: 'LSSHWB,NEZCEO'}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: 'The first two categories are stored in the responsibility matrix r, with
      category 1 occupying the off-diagonals and category 2 occupying the diagonals.
      Similarly, categories 3 and 4 are stored in the availability matrix a,  with
      category 3 occupying the off-diagonals and category 4 occupying the diagonals.Both
      matrices are instantiated with zeros for all elements, upon which the responsibility
      matrix is updated, and then the availability matrix. After that the two matrices
      are updated in the same sequence until the predetermined number of iterations
      is reached, as described above.

      ', font_size: null, font: '', spacing_above: small, icon_align: left, spacing_below: large,
    italic: false, background: '', bold: false, underline: false, icon: ''}
  name: label_6
  layout_properties: {grid_position: 'NOJMOQ,GSWWEN'}
- type: Image
  properties: {role: null, vertical_align: center, height: '200', tooltip: '', border: '',
    foreground: '', visible: true, display_mode: shrink_to_fit, spacing_above: large,
    source: 'data:image/png;base64,',
    spacing_below: small, background: '', horizontal_align: center}
